import React from "react";
import "./App.css";
import Page from "./Page";
import mePic from "./imgs/me.jpg";
import ga from "./imgs/ga-logo.png";

function App() {
  const profexpdata = [
    { id: 1, title: 'Summer 2024', description: 'Additional info for Item 1.' },
    { id: 2, title: 'Summer 2023', description: 'Additional info for Item 2.' },
  ];

  const leadershipexpdata = [
    { id: 1, title: 'President', description: 'Additional info for Item 1.' },
    { id: 2, title: 'Secretary', description: 'Additional info for Item 2.' },
  ];

  return (
    <div className="App">
      <Page mainCookie = {mePic} logo = {ga}> </Page>
      <Page mainCookie = "Professional Experience" info = {profexpdata}> </Page>
      <Page mainCookie = "Projects" info = "Test"> </Page>
      <Page mainCookie = "Leadership" info = {leadershipexpdata}> </Page>
      <Page mainCookie = "More About Me" info = "Test"> </Page>
      <Page mainCookie = "Reach out!" info = "Test"> </Page>
    </div>
  );
}

export default App;
